import "./zapp.scss";
import Home from "./pages/homepage/Home";
import {
  BrowserRouter as Router,
  Routes,
  Route,
} from "react-router-dom";

const App = () => {
  return (
    <Router>
      <Routes>


            <Route path="/movies">
              <Home type="movie" />
            </Route>
            <Route path="/series">
              <Home type="series" />
            </Route>


      </Routes>
    </Router>
  );
};

export default App;
